import React, { Component } from 'react'
import Info from './Info/Info'
import  './Body.css'


class Body extends Component{
    state={
        covidvalue:{
            "tested_positive":36456,
        "tested_negative":621654,
        "tested_total":658110,
        "in_isolation":16019,
        "quarantined":8939,
        "tested_rdt":312402,
        "pending_result":0,
        "recovered":20242,
        "deaths":195
    }
    };

    render(){
        let printinfo=""
        for(let prop in this.state.covidvalue)
        {
            printinfo += <Info type="info" number={this.state.covidvalue[prop]} title={prop}/>
        }
       return(
        <div className="body">
            <div className="row">

            <Info type="info" number="2000" title="Total deaths"/>
            <Info type="danger" number="2000" title="Total deaths"/>
            <Info type="success" number="2000" title="Total deaths"/>
            <Info type="warning" number="2000" title="Total deaths"/>
            <Info type="info" number="2000" title="Total deaths"/>

            </div>
        </div>
        )
    }
}

export default Body
